import './ExpenseItem.css'
function ExpenseItem() {
    return(
        <div className='expense'>
            <div>1st July 2022</div>
            <div>
                <h2>Car Insurance</h2>
                <div>$249.67</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
